B.l4=new A.iU("Education","Saya besar di lingkungan akademik Islami, karena hal tersebut menjadi dasar prinsipil saya menjalankan kehidupan hari ini. untuk daftar riwayat pendidikan dapat kalian lihat dibawah ini.",null)
B.l5=new A.iU("Contact","Saya terbuka untuk menjawab semua pertanyaan kawan-kawan untuk progresifitas kedepan, tangan saya akan terus terbuka untuk saling menggenggam untuk sebuah visi besar kedepan, sehingga karena hal tersebut mudah-mudahan meringankan kawan-kawan untuk menyapa dan memberikan masukan ataupun kritik terhadap saya. semoga saya bisa terus hadir untuk menyapa kawna-kawan semua, Yakin Usaha Sampai!",null)
B.l6=new A.iU("Vision & Mission","Dalam perjalanan mencapai keunggulan dan memenuhi aspirasi, visi dan misi ini berfungsi sebagai kompas yang mengarahkan setiap langkah yang saya ambil. Hari ini, izinkan kami memperkenalkan inti dari cita-cita saya, yang bukan hanya menjadi fondasi dari setiap keputusan strategis yang saya buat, tetapi juga memancarkan esensi dari identitas dan arah tujuan saya.",null)
B.l7=new A.iU("Catatan","Sebagai aktivis, keresahan saya bukan beban, melainkan pendorong yang kuat. Ini menunjukkan kesadaran saya akan ketidakadilan dan ketidakseimbangan di dunia dan keinginan saya yang mendalam untuk membuat perbedaan. Saya tidak puas dengan status quo; saya ingin menjadi katalisator perubahan, seseorang yang berdiri di garis depan, tidak hanya mendorong batas-batas yang ada tetapi juga membuka jalan untuk solusi yang lebih baik, lebih adil, dan lebih inklusif.",null)
B.l8=new A.iU("#DignityHMICakaba","Dalam konteks kekinian, reaktualisasi HMI Cabaka yang memiliki integritas, daya saing, dan martabat menjadi sangat penting. Visi ini tidak hanya merefleksikan aspirasi untuk pembaharuan dan peningkatan dalam organisasi, tetapi juga merespons tantangan zaman yang terus berubah, hal ini akan dijelaskan secara gamblang pada Web personal ini.",null)
